//SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract Array {
    //dynamic uint array
    uint[] public nums = [1, 2, 3];

    //fixed size array
    uint[3] public numsFixed = [4, 5, 6];

    function arrayOps() external {
        nums.push(4); // [1, 2, 3, 4]
        uint x = nums[1]; // returns value in 1st position
        nums[2] = 777; // [1, 2, 777, 4] assignation
        delete nums[1]; // [1, 0, 777, 4]
        nums.pop(); // [1, 0, 777]
        uint len = nums.length; //returns length of array

        // create array in memory
        uint[] memory a = new uint[](5); //cant be dynamic
        a[1] = 123; //assignation
    }

    //to return an array in a function it should be stored in memory first
    function returnArray() external view returns (uint[] memory) {
        return nums;
    }
}
